import Header from './Header';
import Nav from './Nav';
import Footer from  './Footer';
import './main.css'

function HomeTwice() {
  return (
    <div id='wrap'>
      <Header></Header>
      <Nav></Nav>
      <div className='container'>
        <div className='main-bgimg'>123</div>
      </div>
      <Footer></Footer>
    </div>
  );
}

export default HomeTwice;
